import React, { useState } from "react";
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  StyleSheet,
  Image
} from "react-native";

const Register = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <Text style={styles.text}>Register Page</Text>
      <Image style={styles.image} source={{uri: "https://w7.pngwing.com/pngs/621/196/png-transparent-e-commerce-logo-logo-e-commerce-electronic-business-ecommerce-angle-text-service.png"}}/>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    height: 500,
    width: 500,
    alignItems: "center",
    justifyContent: "center",
    borderWidth: 2,
  },
  text: {
    justifyContent: "center",
    fontSize: 30
  },
  image: {
    height: 100,
    widht: 100
  }
});

export default Register;
